import WelcomeScreen from './Welcome';
import RegisterScreen from './Register';

export default [
  {
    name: 'Login',
    component: WelcomeScreen,
    options: { headerShown: false },
  },
  {
    name: 'Register',
    component: RegisterScreen,
    options: { headerShown: false },
  },
];
